import {AuthService} from '../../services/auth.service';
import {BaseComponent} from '../../util/base.component';
import {AnotherService} from '../../services/another.service';

@Component({
  standalone: true,
  selector: 'app-inject-example',
  templateUrl: './inject-example.component.html',
  styleUrls: ['./inject-example.component.scss']
})

export class InjectExampleComponent extends BaseComponent{

  authService = inject(AuthService);
  another = inject(AnotherService);

  constructor() {
    super()
    console.log(this.authService.myVar)
  }


}
